    const [formData, setFormData] = useState({
        song: "",
        artist: "",
        tuning: "",
        capo: "",
        bpm: ""
    })


    const onSubmit = (e) => {
        e.preventDefault()
    }

    return (
        <div className="flex h-screen items-center justify-center text-white ">
            <form className="md:flex h-1/2 w-1/4 text-md flex flex-col bg-slate-400 border border-gray-900 p-6 rounded-lg justify-center items-center text-center">
                <input placeholder="Song Name" name="song" className="text-xl text-center rounded-md mt-3"></input>
                <input placeholder="Artist" name="artist" className="text-xl rounded-md mt-3"></input>
                <input placeholder="Tuning" name="tuning" className="text-xl rounded-md mt-3"></input>
                <input placeholder="Capo" name="capo" className="text-xl rounded-md mt-3"></input>
                <input placeholder="BPM" name="bpm" className="text-xl rounded-md mt-3"></input>
                <button className="flex mt-4 text-black bg-white w-1/4">Create Project</button>
            </form>
        </div>
    )

}

export default CreateNewTabForm
